import React from 'react';
import './Media.css'

const Audio = (props) => (
    <div >
        <audio controls autoPlay >
            <source src={props.data.previewUrl} type="audio/x-m4a" />
            <source src={props.data.previewUrl} type="audio/ogg" />
            <source src={props.data.previewUrl} type="audio/mp4" />
        </audio>
    </div>
);

export default Audio;
